    public static int lengthOfLongestSubstring(String s) {
        boolean []occurrences = new boolean[256];
        int count = 0;

        int i = 0, j = 0;
        while (i < s.length()) {
            if (!occurrences[s.charAt(i)]) {
                occurrences[s.charAt(i)] = true;
                i++;
            }
            else {
                count = Math.max(count, i - j);
                occurrences[s.charAt(j)] = false;
                j++;
            }
        }

        return Math.max(i - j, count);
    }

